import React from 'react';

export default function About() {
    return (
    <div className='about'>
        <h1>About</h1>
        <h2>Boost your studying potential!</h2>
        <p>Having trouble studying for your clases? Find a group of students like you and ace your next midterms! With an easy to use interface you'll be able to find a study group to help you pass that calculus class. 
        Or perhaps you need help making your remote control plane for engineering class? We've got the resources to get you connected with fellow problem solvers to help you get your assignment back on track.</p>
    </div>
    )
}
